namespace RonSijm.FluidHumidifier.Factories.EMR;

public class ClusterFactory(string resourceName = null, Action<Humidifier.EMR.Cluster> factoryAction = null) : ResourceFactory<Humidifier.EMR.Cluster>(resourceName)
{

    internal List<InnerClusterApplicationFactory> ApplicationsFactories { get; set; } = [];

    internal List<InnerClusterBootstrapActionConfigFactory> BootstrapActionsFactories { get; set; } = [];

    internal List<InnerClusterConfigurationFactory> ConfigurationsFactories { get; set; } = [];

    internal List<InnerClusterPlacementGroupConfigFactory> PlacementGroupConfigsFactories { get; set; } = [];

    internal List<InnerClusterStepConfigFactory> StepsFactories { get; set; } = [];

    internal InnerClusterAutoTerminationPolicyFactory AutoTerminationPolicyFactory { get; set; }

    internal InnerClusterJobFlowInstancesConfigFactory InstancesFactory { get; set; }

    internal InnerClusterKerberosAttributesFactory KerberosAttributesFactory { get; set; }

    internal InnerClusterManagedScalingPolicyFactory ManagedScalingPolicyFactory { get; set; }

    protected override Humidifier.EMR.Cluster Create()
    {
        var clusterResult = CreateCluster();
        factoryAction?.Invoke(clusterResult);

        return clusterResult;
    }

    private Humidifier.EMR.Cluster CreateCluster()
    {
        var clusterResult = new Humidifier.EMR.Cluster
        {
            GivenName = InputResourceName,
        };

        return clusterResult;
    }
    public override void CreateChildren(Humidifier.EMR.Cluster result)
    {
        base.CreateChildren(result);

        result.Applications = ApplicationsFactories.Any() ? ApplicationsFactories.Select(x => x.Build()).ToList() : null;
        result.BootstrapActions = BootstrapActionsFactories.Any() ? BootstrapActionsFactories.Select(x => x.Build()).ToList() : null;
        result.Configurations = ConfigurationsFactories.Any() ? ConfigurationsFactories.Select(x => x.Build()).ToList() : null;
        result.PlacementGroupConfigs = PlacementGroupConfigsFactories.Any() ? PlacementGroupConfigsFactories.Select(x => x.Build()).ToList() : null;
        result.Steps = StepsFactories.Any() ? StepsFactories.Select(x => x.Build()).ToList() : null;
        result.AutoTerminationPolicy ??= AutoTerminationPolicyFactory?.Build();
        result.Instances ??= InstancesFactory?.Build();
        result.KerberosAttributes ??= KerberosAttributesFactory?.Build();
        result.ManagedScalingPolicy ??= ManagedScalingPolicyFactory?.Build();
    }

} // End Of Class

